import {useState, useEffect} from 'react';




const HomePage = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch("https://corona.lmao.ninja/all")
            .then(data => data.json())
            .then(cor => {
                setData(cor)
            })
            console.log(cor)
            .catch(error => {
                console.log(error)
            })
    },[])

    return (
        <>

        </>
    );
}

export default HomePage
